import React from "react";
import { TextField } from "@material-ui/core";

import { FieldTitle } from "../../../atoms";
import { AutoCompleteField } from "../../../organisms";
import Icons from "../../../../resources/icons";
import "./index.scss";

export const RegisterTwo = ({
  user,
  onUserChange,
  service,
  onServiceChange,
}) => {
  return (
    <div className="two-columns">
      <div className="column">
        <FieldTitle icon={Icons.user} label="Nombre" />
        <TextField
          variant="outlined"
          margin="normal"
          label="Nombre"
          name="name"
          value={user.name}
          onChange={onUserChange}
          inputProps={{ tabIndex: "1" }}
        />
        <FieldTitle icon={Icons.user} label="Apellidos" />
        <TextField
          variant="outlined"
          margin="normal"
          label="Apellidos"
          name="lastname"
          value={user.lastname}
          onChange={onUserChange}
          inputProps={{ tabIndex: "3" }}
        />

        <FieldTitle icon={Icons.email} label="Correo electrónico" />
        <TextField
          variant="outlined"
          margin="normal"
          label="Correo electrónico"
          name="email"
          type="email"
          value={user.email}
          onChange={onUserChange}
          inputProps={{ tabIndex: "5" }}
        />

        <FieldTitle icon={Icons.phone} label="Teléfono" />
        <div className="field-with-prefix MuiFormControl-marginNormal">
          <AutoCompleteField
            name="phonePrefix"
            value={user.phonePrefix}
            className="field-input prefix"
            dataSourceResolver={(data) => data.countries}
            onChange={onUserChange}
            source="country"
            labelResolver={({ dialCode }) => dialCode}
            label="+1"
          />
          <TextField
            type="text"
            className="field-input"
            variant="outlined"
            name="phone"
            value={user.phoneNumber}
            onChange={onUserChange}
            inputProps={{ tabIndex: "7" }}
          />
        </div>
        <FieldTitle icon={Icons.ping_drop} label="Ubicación" />
        <div className="field-with-prefix MuiFormControl-marginNormal">
          <AutoCompleteField
            type="text"
            name="zipCode"
            className="field-input prefix"
            value={user.zipCode}
            onChange={onUserChange}
            dataSourceResolver={(data) => data.countries}
            source="country"
            labelResolver={({ code }) => code}
            label="ES"
          />
          <TextField
            type="text"
            name="city"
            className="field-input"
            variant="outlined"
            value={user.city}
            onChange={onUserChange}
            inputProps={{ tabIndex: "8" }}
          />
        </div>
      </div>
      <div className="column">
        <FieldTitle icon={Icons.world} label="Idioma" />
        <AutoCompleteField
          name="language"
          margin="normal"
          value={user.language}
          dataSourceResolver={(data) => data.languages}
          onChange={onUserChange}
          source="language"
          labelResolver={({ name }) => name}
          label="Idioma"
        />
        <FieldTitle icon={Icons.text_snippet} label="Servicio" />
        <TextField
          variant="outlined"
          margin="normal"
          label="Servicio"
          name="name"
          value={service.name}
          onChange={onServiceChange}
          inputProps={{ tabIndex: "4" }}
        />
        <FieldTitle icon={Icons.map} label="Dirección" />
        <TextField
          variant="outlined"
          margin="normal"
          label="Dirección"
          name="address"
          value={service.address}
          onChange={onUserChange}
          inputProps={{ tabIndex: "6" }}
        />
      </div>
    </div>
  );
};
